ed if the owner or co-owner lives in the unit, even if it is mortgaged or not fully paid for. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSOWNER_CY_P":{"type":"number","alias":"2024 Owner Occupied HUs: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Owner-Occupied Housing Units in the geographic area. A housing unit is owner-occupied if the owner or co-owner lives in the unit. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSOWNER_FY_P":{"type":"number","alias":"2029 Owner Occupied HUs: Percent","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Owner-Occupied Housing Units in the geographic area. Owner-Occupied Housing Units are Housing Units where the primary occupant is the owner or co-owner of the property. Housing Units are living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"OWNERRENTERRENTER00_P":{"type":"number","alias":"2000 Renter Occupied HUs: Percent","vintage":"2000","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2000 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent."},"HOUSINGUNITTOTALSRENTER10_P":{"type":"number","alias":"2010 Renter Occupied Hus: Percent","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent.  See <a target='_blank' href='https://links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"HOUSINGUNITTOTALSRENTER20_P":{"type":"number","alias":"2020 Renter Occupied HUs: Percent","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2020 base for Renter Occupied Housing Units by Size. This base variable is used to calculate the percentage of Renter Occupied Housing Units by Size . Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSRENTER_CY_P":{"type":"number","alias":"2024 Renter Occupied HUs: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Renter-Occupied Housing Units in the geographic area. All occupied housing units which are not owner-occupied, whether they are rented or occupied without payment of rent, are classified as renter-occupied. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSRENTER_FY_P":{"type":"number","alias":"2029 Renter Occupied HUs: Percent","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent. Housing Units are living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POPULATIONTOTALSPOPGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Population","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 population compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSEHOLDTOTALSHHGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Households","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 household compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of households between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSINGUNITTOTALSHUGRW0020":{"type":"number","alias":"2000-2020 Growth Rate: Housing Units","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The 2000-2020 housing unit compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of housing units between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HOUSINGUNITTOTALSTOTHU10":{"type":"number","alias":"2010 Total Housing Units","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"HOUSINGUNITTOTALSTOTHU20":{"type":"number","alias":"2020 Total Housing Units","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"HISTORICALHOUSINGTOTHU_CY":{"type":"number","alias":"2024 Total Housing Units","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSTOTHU_FY":{"type":"number","alias":"2029 Total Housing Units","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarters—such as boats, RVs, and tents—are counted as housing units only when occupied if it is either the occupant’s usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEBYRACEBYSEX2010TOTHH10":{"type":"number","alias":"2010 Total Households","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"HOUSEHOLDTOTALSTOTHH20":{"type":"number","alias":"2020 Total Households","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"ATRISKTOTHH_CY":{"type":"number","alias":"2024 Total Households","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEBYRACEBYSEXTOTHH_FY":{"type":"number","alias":"2029 Total Households","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. It excludes group quarters. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."}},"comparison_0":{"STORE_ID":{"type":"string","alias":"STORE_ID","vintage":null,"source":null,"units":null,"decimals":null},"AREA_ID":{"type":"string","alias":"AREA_ID","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyName":{"type":"string","alias":"Standard geography name","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyID":{"type":"string","alias":"Standard geography Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"POLICYDIVINDX10":{"type":"number","alias":"2010 Diversity Index","vintage":"2010","source":"U.S. Census","units":null,"decimals":null,"definition":"Esri 2010 calculation of Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. Based on U.S. Census 2010 data. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"HISPANICORIGINDIVINDX20":{"type":"number","alias":"2020 Diversity Index","vintage":"2020","source":"U.S. Census","units":null,"decimals":null,"definition":"The diversity index summarizes racial and ethnic diversity. The index shows the likelihood that two persons, chosen at random from the same area, belong to different race or ethnic groups. The index ranges from 0 (no diversity) to 100 (complete diversity). For example, a diversity index of 59 means there is a 59 percent probability that two people randomly chosen belong to different race or ethnic groups. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2024 Diversity Index","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYDIVINDX_FY":{"type":"number","alias":"2029 Diversity Index","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 forecasted Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>Read more.</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."}},"comparison_1":{"STORE_ID":{"type":"string","alias":"STORE_ID","vintage":null,"source":null,"units":null,"decimals":null},"AREA_ID":{"type":"string","alias":"AREA_ID","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyName":{"type":"string","alias":"Standard geography name","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyID":{"type":"string","alias":"Standard geography Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"HOMEVALUEMEDVAL_FY":{"type":"number","alias":"2029 Median Home Value","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOMEVALUEMEDVAL_CY":{"type":"number","alias":"2024 Median Home Value","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://link ulator.KEYUSFACTSOWNER_CY_P","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of Owner-Occupied Housing Units in the geographic area. A housing unit is owner-occupied if the owner or co-owner lives in the unit. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSOWNER_FY_P":{"id":"OWNER_FY_P","fullName":"KeyUSFacts.OWNER_FY_P","alias":"2029 Owner Occupied HUs: Percent","fieldName":"KEYUSFACTSOWNER_FY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSOWNER_FY_P","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Owner-Occupied Housing Units in the geographic area. Owner-Occupied Housing Units are Housing Units where the primary occupant is the owner or co-owner of the property. Housing Units are living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.OWNERRENTERRENTER00_P":{"id":"RENTER00_P","fullName":"OwnerRenter.RENTER00_P","alias":"2000 Renter Occupied HUs: Percent","fieldName":"OWNERRENTERRENTER00_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.OWNERRENTERRENTER00_P","type":"esriFieldTypeDouble","vintage":"2000","source":"U.S. Census","definition":"U.S. Census 2000 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent."},"dataCollectionsCalculator.HOUSINGUNITTOTALSRENTER10_P":{"id":"RENTER10_P","fullName":"housingunittotals.RENTER10_P","alias":"2010 Renter Occupied Hus: Percent","fieldName":"HOUSINGUNITTOTALSRENTER10_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSRENTER10_P","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent.  See <a target='_blank' href='https://links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"dataCollectionsCalculator.HOUSINGUNITTOTALSRENTER20_P":{"id":"RENTER20_P","fullName":"housingunittotals.RENTER20_P","alias":"2020 Renter Occupied HUs: Percent","fieldName":"HOUSINGUNITTOTALSRENTER20_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSRENTER20_P","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"U.S. Census 2020 base for Renter Occupied Housing Units by Size. This base variable is used to calculate the percentage of Renter Occupied Housing Units by Size . Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.KEYUSFACTSRENTER_CY_P":{"id":"RENTER_CY_P","fullName":"KeyUSFacts.RENTER_CY_P","alias":"2024 Renter Occupied HUs: Percent","fieldName":"KEYUSFACTSRENTER_CY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSRENTER_CY_P","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Renter-Occupied Housing Units in the geographic area. All occupied housing units which are not owner-occupied, whether they are rented or occupied without payment of rent, are classified as renter-occupied. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSRENTER_FY_P":{"id":"RENTER_FY_P","fullName":"KeyUSFacts.RENTER_FY_P","alias":"2029 Renter Occupied HUs: Percent","fieldName":"KEYUSFACTSRENTER_FY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSRENTER_FY_P","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Renter-Occupied Housing Units in the geographic area. Renter-Occupied Housing Units are any occupied housing unit that is not Owner-Occupied, whether rented or occupied without payment of rent. Housing Units are living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.POPULATIONTOTALSPOPGRW0020":{"id":"POPGRW0020","fullName":"populationtotals.POPGRW0020","alias":"2000-2020 Growth Rate: Population","fieldName":"POPULATIONTOTALSPOPGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.POPULATIONTOTALSPOPGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 population compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSEHOLDTOTALSHHGRW0020":{"id":"HHGRW0020","fullName":"householdtotals.HHGRW0020","alias":"2000-2020 Growth Rate: Households","fieldName":"HOUSEHOLDTOTALSHHGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSHHGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 household compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of households between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHUGRW0020":{"id":"HUGRW0020","fullName":"housingunittotals.HUGRW0020","alias":"2000-2020 Growth Rate: Housing Units","fieldName":"HOUSINGUNITTOTALSHUGRW0020","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHUGRW0020","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The 2000-2020 housing unit compound annual growth rate (CAGR) is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of housing units between the years 2000 and 2020. An annualized rate means that the resultant value reflects a rate of change covering a twelve-month time period. This component of the calculation permits the analysis of multiple growth rates between values measured from differing points in time since the change is computed using a common time period of twelve months. The compound component of the expression simply means that the annualized growth rate is repeated, or compounded, each year. Moreover, the CAGR can colloquially be referred to as growth rate, annual rate, annualized growth rate, or compound growth rate. See the variable formula used at: https://doc.arcgis.com/en/esri-demographics/reference/essential-vocabulary.htm See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10":{"id":"TOTHU10","fullName":"housingunittotals.TOTHU10","alias":"2010 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Housing Units in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/2010-census'>Census 2010</a> for more information."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20":{"id":"TOTHU20","fullName":"housingunittotals.TOTHU20","alias":"2020 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Housing Units (occupied and vacant). Housing units are classified as being either occupied or vacant. These are living quarters in which the occupant or occupants live separately from any other individuals in the building and have direct access to their living quarters from outside the building or through a common hall. Housing units are usually houses, apartments, mobile homes, groups of rooms, or single rooms that are occupied as separate living quarters. They are residences for single individuals, for groups of individuals, or for families who live together. For vacant housing units, the criteria of separateness and direct access are applied to the intended occupants whenever possible. Nontraditional living quarters, such as boats, RVs, and tents, are considered housing units only if someone is living in them and they are either the occupant’s usual residence or the occupant has no usual residence elsewhere. These nontraditional living arrangements are not considered housing units if they are vacant. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.HISTORICALHOUSINGTOTHU_CY":{"id":"TOTHU_CY","fullName":"HistoricalHousing.TOTHU_CY","alias":"2024 Total Housing Units","fieldName":"HISTORICALHOUSINGTOTHU_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HISTORICALHOUSINGTOTHU_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of Total Housing Units, occupied or vacant, in the geographic area. A housing unit is a house, an apartment, a mobile home, a group of rooms, or a single room that is occupied (or if vacant, is intended for occupancy) as separate living quarters. Occupants can be individuals, roommates, families who live together, or any other group of related or unrelated people who share living arrangements. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU_FY":{"id":"TOTHU_FY","fullName":"housingunittotals.TOTHU_FY","alias":"2029 Total Housing Units","fieldName":"HOUSINGUNITTOTALSTOTHU_FY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSTOTHU_FY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Total Housing Units (occupied or vacant) in the geographic area. Occupied Housing Units are currently occupied living quarters—such as a house, apartment, mobile home, or rooms—in which the occupant(s) live separately from individuals who are not part of their household and to which they have free, direct access. Occupants can be individuals, unrelated roommates, or families who live together. For vacant housing units, the living space criteria is identical to that of occupied units. Some nontraditional living quarters—such as boats, RVs, and tents—are counted as housing units only when occupied if it is either the occupant’s usual residence or if the occupant has no other residence elsewhere. Importantly, these nontraditional living quarters are not counted as vacant housing units when unoccupied. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10":{"id":"TOTHH10","fullName":"agebyracebysex2010.TOTHH10","alias":"2010 Total Households","fieldName":"AGEBYRACEBYSEX2010TOTHH10","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEBYRACEBYSEX2010TOTHH10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"U.S. Census 2010 count of the Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence.See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20":{"id":"TOTHH20","fullName":"householdtotals.TOTHH20","alias":"2020 Total Households","fieldName":"HOUSEHOLDTOTALSTOTHH20","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSTOTHH20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"Total Households is the total of occupied housing units. The occupants may be one individual, a single family, two or more families living together, or any other group of related or unrelated individuals who share living arrangements. Occupied rooms or suites of rooms in hotels, motels, and similar places are classified as housing units only when occupied by permanent residents; that is, occupied by individuals who consider the hotel their usual place of residence or who have no usual place of residence elsewhere. However, when rooms in hotels and motels are used to provide shelter for people experiencing homelessness, they are not housing units. Rooms used in this way are considered group quarters. Source U.S. Census 2020 DHC. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'>Census 2020</a> for more information on Census 2020."},"dataCollectionsCalculator.ATRISKTOTHH_CY":{"id":"TOTHH_CY","fullName":"AtRisk.TOTHH_CY","alias":"2024 Total Households","fieldName":"ATRISKTOTHH_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTHH_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.AGEBYRACEBYSEXTOTHH_FY":{"id":"TOTHH_FY","fullName":"agebyracebysex.TOTHH_FY","alias":"2029 Total Households","fieldName":"AGEBYRACEBYSEXTOTHH_FY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.AGEBYRACEBYSEXTOTHH_FY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Total Households in the geographic area. Total Households is the sum of all Households. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. It excludes group quarters. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"comparison_0.POLICYDIVINDX10":{"id":"DIVINDX10","fullName":"Policy.DIVINDX10","alias":"2010 Diversity Index","fieldName":"POLICYDIVINDX10","precision":1,"calculatorName":"comparison_0","templateName":"comparison_0.POLICYDIVINDX10","type":"esriFieldTypeDouble","vintage":"2010","source":"U.S. Census","definition":"Esri 2010 calculation of Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. Based on U.S. Census 2010 data. See <a target='_blank' href='https://links.esri.com/demographics/census-2010'>Census 2010</a> for more information on Census 2010."},"comparison_0.HISPANICORIGINDIVINDX20":{"id":"DIVINDX20","fullName":"hispanicorigin.DIVINDX20","alias":"2020 Diversity Index","fieldName":"HISPANICORIGINDIVINDX20","precision":1,"calculatorName":"comparison_0","templateName":"comparison_0.HISPANICORIGINDIVINDX20","type":"esriFieldTypeDouble","vintage":"2020","source":"U.S. Census","definition":"The diversity index summarizes racial and ethnic diversity. The index shows the likelihood that two persons, chosen at random from the same area, belong to different race or ethnic groups. The index ranges from 0 (no diversity) to 100 (complete diversity). For example, a diversity index of 59 means there is a 59 percent probability that two people randomly chosen belong to different race or ethnic groups. See <a target='_blank' href='https://links.esri.com/demographics/census-2020'
